import React, { Component } from 'react';
import '../App.css';

class Todos extends Component {
  state = {
    todos: [
      {
        id: 1,
        title: 'Take out the trash',
        completed: false
      },
      {
        id: 2,
        title: 'Night supplication',
        completed: false
      },
      {
        id: 3,
        title: 'Go to mosque',
        completed: false
      }
    ]
  }
  render() {
    console.log(this.state.todos)
    return (
      <div >
        <h1>Todos</h1>
      </div>
    );
  }
}

export default Todos;
